import React from 'react';
import { StyleSheet} from 'react-native';

export const styles = StyleSheet.create({
  container: {
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  consumer: {
    width: "280",
    height: "40",
    background: "#8fd7d3",
    borderRadius: "20",
  }
});
